    .available-text {
      margin-bottom: 20px;
      font-size: 26px;
      color: #787f8c;
    }
    .money {
      font-size: 49px;
      font-weight: bold;
      color: #13161b;
    }
    .usdt-text {
      margin-left: 17px;
      font-size: 49px;
      color: #868d9a;
    }
  }

  .protocols-address-container {
    width: 100%;
    margin: 21px 0;
    padding: 0 21px;
    background-color: #fff;
    font-size: 25px;
    border-radius: 14px;
    .item-row {
      width: 100%;
      height: 70px;
    }
    .item-title-row {
      .label {
        color: #13161b;
        font-size: 28px;
      }
      .toggle-select-text {
        color: #2aaef2;
      }
    }
    .label {
      color: #787f8c;
    }
    .value {
      color: #13161b;
    }
  }

  .withdraw-coins-info-container {
    width: 100%;
    height: auto;
    background-color: #fff;
    border-radius: 14px;
    .withdraw-coins-amount-text {
      margin: 27px 0 20px 0;
      padding-left: 20px;
      font-size: 28px;
      color: #13161b;
    }
    .row-item {
      padding: 0 21px;
    }
    .input-container {
      margin: 0 21px 20px 21px;
      padding: 0 18px;
      background-image: linear-gradient(#ebf1f6, #ebf1f6);
      font-size: 25px;
      border-radius: 7px;
      .amount-input {
        flex: 1;
        padding-left: 0;
        background-color: #ebf1f6;
      }
      .coin-unit {
        margin: 0 28px;
        color: #868d9a;
      }
      .max-amount {
        color: var(--van-button-primary-background);
      }
    }
    .row-item {
      width: 100%;
      height: 70px;
      font-size: 25px;
      .label {
        color: #787f8c;
      }
      .value {
        color: #13161b;
        span {
          margin-left: 2px;
        }
      }
    }
  }

  .bind-address-tips {
    flex: 1;
    margin-top: 70px;
    font-size: 25px;
    color: #666;
  }

  .withdraw-coins-tips {
    margin: auto 0 21px 0;
    font-size: 25px;
    color: #ff0000;
  }
  .btn-submit {
    width: 669px;
    height: 80px;
    line-height: 80px;
    font-size: 31px;
    background-color: var(--van-button-primary-background);
    color: #fff;
    border-radius: 7px;
  }

  :deep(.dialog-auth) {
    width: 708px;
    height: auto;
    padding: 40px;
    .van-dialog__header {
      padding: 0;
      font-size: 29px;
      color: #13161b;
    }
    .van-dialog__content {
      margin: 33px 0 35px 0;
      font-size: 25px;
      color: #787f8c;
      text-align: justify;
      .van-field {
        background-color: #ebf1f6;
      }
    }
    .van-dialog__footer {
      padding: 0;
    }
    .van-dialog__confirm,
    .btn-confirm {
      width: 100%;
      height: 80px;
      font-size: 31px;
      background: var(--van-button-primary-background);
      color: #fff;
      border: 0;
      border-radius: 8px;
    }
    .icon-close {
      position: absolute;
      right: 40px;
      top: 24px;
    }
    img {
      width: 100%;
      margin-top: 20px;
    }
  }

  :deep(.usdt-sheet) {
    // padding-bottom: 15px;
    .van-action-sheet__description {
      padding: 30px 18px;
      font-size: 33px;
      font-weight: bold;
      color: #343434;
      &::after {
        left: 18px;
        right: 18px;
        border-color: #d9d8d8;
      }
    }
    .van-action-sheet__content {
      padding: 0 18px;
    }
    .item-card {
      margin: 0 13px 0 27px;
      height: 90px;
      border-bottom: rgba($color: #efeeee, $alpha: 0.5) 1px solid;
      &:last-child {
        border-bottom: 0;
      }
    }
    .toggle-container {
      width: 39px;
      height: 39px;
    }
    .usdt-icon {
      width: 53px;
      height: 53px;
      border-radius: 50%;
      overflow: hidden;
    }
  }

  .van-number-keyboard {
    .icon-delete-container {
      width: 100%;
      height: 100%;
    }
  }
}

